import React from "react";
// import "./style.css";

function Nav() {
    return (
        <nav className="navbar navbar-expand-xl navbar-dark bg-dark">
            <div>
                {/* Left */}
                <h1>Clicky Game</h1>
            </div>
            <div>

                {/* Center */}
                {/* guess correct or incorrect */}
                <h3>You guessed incorrect</h3>
            </div>

            <div>
                {/* Right */}
                {/* Score */}
                <h3>Score: 0 | Top Score: 4</h3>

                {/* Top Score */}
            </div>

        </nav>
    );
}

export default Nav;
